sub = [3, 6, 4, 9, 7, 2, 5, 1, 8, 0]


def tonum(xs):
    return int("".join(map(str, xs[::-1])))


def search(p, q):
    if len(p) >= 155:
        return
    # print(p, q)
    m = 10 ** (len(p) + 1)
    for x in range(10):
        pp = p + [x]
        qq = q + [sub[x]]
        pn = tonum(pp)
        qn = tonum(qq)
        if pn > 1 and n % pn == 0:
            print(pn)
            exit()
        if pn * qn % m == n % m:
            search(pp, qq)


